import React, { useState } from "react";
import {
  Button,
  Grid,
  Paper,
  TextField,
  Typography,
  MenuItem,
  InputAdornment
} from "@mui/material";
import { MyObject } from "./types";
import { setDeep } from "./utils";
import config from "./configurationToImplement.json";

type StaticFormProps = {
  object: MyObject;
};

type FieldConfig = {
  type: "textInput" | "integerInput" | "enumInput" | "currencyInput";
  label: string;
  path: string;
  defaultValue?: string | number;
  min?: number;
  max?: number;
  values?: string[];
  currencies?: string[];
};

// helper to safely access nested fields
const getValueFromPath = (obj: MyObject, path: string): string | number | undefined => {
  return path.split(".").reduce((acc: unknown, key: string) => {
    if (typeof acc === "object" && acc !== null && key in acc) {
      return (acc as Record<string, unknown>)[key];
    }
    return undefined;
  }, obj) as string | number | undefined;
};

const StaticForm = ({ object }: StaticFormProps): JSX.Element => {
  const [myObject, setMyObject] = useState<MyObject>(object);
  const [savedObject, setSavedObject] = useState<MyObject>();

  const handleChange =
    (
      path: string,
      transform: (val: string) => string | number = (val) => val
    ) =>
    (event: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
      const value = transform(event.target.value);
      setMyObject(setDeep(myObject, path, value));
    };

  const renderField = (field: FieldConfig): JSX.Element | null => {
    const { type, label, path, defaultValue } = field;
    const valueFromData = getValueFromPath(myObject, path);
    const value = valueFromData ?? defaultValue ?? "";

    switch (type) {
      case "textInput": {
        return (
          <Grid item xs={12} key={path}>
            <TextField
              fullWidth
              label={label}
              value={value}
              onChange={handleChange(path)}
            />
          </Grid>
        );
      }

      case "integerInput": {
        return (
          <Grid item xs={12} key={path}>
            <TextField
              fullWidth
              label={label}
              type="number"
              inputProps={{ min: field.min, max: field.max }}
              value={value}
              onChange={handleChange(path, (v) => parseInt(v, 10))}
            />
          </Grid>
        );
      }

      case "enumInput": {
        return (
          <Grid item xs={12} key={path}>
            <TextField
              fullWidth
              select
              label={label}
              value={value}
              onChange={handleChange(path)}
            >
              {field.values?.map((option) => (
                <MenuItem key={option} value={option}>
                  {option}
                </MenuItem>
              ))}
            </TextField>
          </Grid>
        );
      }

      case "currencyInput": {
        const currencyPath = `${path}.currency`;
        const valuePath = `${path}.value`;
        const currValue = getValueFromPath(myObject, valuePath) ?? "";
        const currCurrency =
          getValueFromPath(myObject, currencyPath) ?? field.currencies?.[0] ?? "";

        return (
          <Grid item xs={12} key={path}>
            <Grid container spacing={2}>
              <Grid item xs={4}>
                <TextField
                  select
                  fullWidth
                  label="Currency"
                  value={currCurrency}
                  onChange={handleChange(currencyPath)}
                >
                  {field.currencies?.map((curr) => (
                    <MenuItem key={curr} value={curr}>
                      {curr}
                    </MenuItem>
                  ))}
                </TextField>
              </Grid>
              <Grid item xs={8}>
                <TextField
                  fullWidth
                  type="number"
                  label={label}
                  inputProps={{ min: field.min, max: field.max }}
                  value={currValue}
                  onChange={handleChange(valuePath, (v) => parseFloat(v))}
                  InputProps={{
                    startAdornment: (
                      <InputAdornment position="start">
                        {currCurrency}
                      </InputAdornment>
                    )
                  }}
                />
              </Grid>
            </Grid>
          </Grid>
        );
      }

      default:
        return null;
    }
  };

  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        <Paper style={{ padding: "20px", margin: "10px" }}>
          <Typography variant="h4">Dynamic Vehicle Form</Typography>
          <Grid container spacing={2} paddingTop={2}>
            {config.map((field: unknown) =>
              renderField(field as FieldConfig)
            )}
          </Grid>
          <Grid item xs={12}>
            <div style={{ marginTop: "20px" }}>
              <Button variant="contained" onClick={() => setSavedObject(myObject)}>
                Save Changes
              </Button>
            </div>
          </Grid>
        </Paper>
      </Grid>

      <Grid item xs={12}>
        <Paper style={{ padding: "20px", margin: "10px" }}>
          <Typography variant="h5">Updated Output</Typography>
          <pre>{JSON.stringify(savedObject, null, 2)}</pre>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default StaticForm;
